import React, { useState } from 'react';
import { Mail, Phone, MapPin, MessageCircle, Send } from 'lucide-react';
import ContactForm from '../components/ContactForm';
import {FaWhatsapp} from 'react-icons/fa';
<FaWhatsapp />

const Contact = () => {
  const [isFormOpen, setIsFormOpen] = useState(false);

  const handleWhatsApp = () => {
    const phoneNumber = '8142200317'; // Replace with your WhatsApp number
    const message = 'Hi! I have a question about your courses. Can you help me?';
    const whatsappUrl = `https://wa.me/${phoneNumber}?text=${encodeURIComponent(message)}`;
    window.open(whatsappUrl, '_blank');
  };

  const openContactForm = () => {
    setIsFormOpen(true);
  };

  const closeForm = () => {
    setIsFormOpen(false);
  };

  return (
    <div className="min-h-screen bg-white pt-16">
      {/* Hero */}
      <section className="py-20 gradient-bg text-white">
        <div className="max-w-4xl mx-auto px-4 text-center" data-aos="fade-up">
          <h1 className="text-4xl md:text-5xl font-bold font-heading mb-6">Contact Us</h1>
          <p className="text-xl max-w-2xl mx-auto mb-6">
            Have questions or want to get in touch? Fill out the form below and our team will respond soon.
          </p>
        </div>
      </section>

      {/* Contact Form & Info */}
      <section className="py-16 bg-gray-50">
        <div className="max-w-5xl mx-auto px-4 grid md:grid-cols-2 gap-12 items-center">
          {/* Contact Form Card */}
          <div data-aos="fade-up">
            <div className="bg-white p-8 rounded-xl shadow-lg">
              <h2 className="text-2xl font-bold text-gray-900 mb-6">Get in Touch</h2>
              <p className="text-gray-600 mb-6">
                Ready to start your learning journey? Fill out the form and we'll get back to you within 24 hours.
              </p>
              <button 
                onClick={openContactForm}
                className="w-full btn-primary flex items-center justify-center"
              >
                <Send className="mr-2 h-5 w-5" />
                Open Contact Form
              </button>
            </div>
          </div>

          {/* Contact Info & Illustration */}
          <div data-aos="fade-up" data-aos-delay="200" className="space-y-8">
            <div className="bg-primary-50 rounded-xl p-6 shadow space-y-4">
              <div className="flex items-center">
                <Mail className="h-5 w-5 text-primary-600 mr-3" />
                <span className="font-medium text-gray-700">info@fiesta.com</span>
              </div>
              <div className="flex items-center">
                <Phone className="h-5 w-5 text-primary-600 mr-3" />
                <span className="font-medium text-gray-700">+1 (555) 123-4567</span>
              </div>
              <div className="flex items-center">
                <MapPin className="h-5 w-5 text-primary-600 mr-3" />
                <span className="font-medium text-gray-700">123 Education St, Tech City, TC 12345</span>
              </div>
              <button 
                onClick={handleWhatsApp}
                className="w-full bg-green-500 hover:bg-green-600 text-white font-semibold py-3 px-6 rounded-lg transition-all duration-300 transform hover:scale-105 shadow-lg hover:shadow-xl flex items-center justify-center"
              >
                <FaWhatsapp className="mr-2 h-5 w-5" />
                Chat on WhatsApp
              </button>
            </div>
            <img src="https://undraw.co/api/illustrations/undraw_mail_sent_re_0ofv.svg" alt="Contact Illustration" className="w-full rounded-xl shadow" />
          </div>
        </div>
      </section>

      {/* Contact Form Modal */}
      <ContactForm 
        isOpen={isFormOpen}
        onClose={closeForm}
        courseTitle={null}
        isDemo={false}
      />
    </div>
  );
};

export default Contact;
